import React from 'react';

const aTags = ['Home', 'Bio', 'Gallery'];
const liStyle = {

};

const listItems = aTags.map((item, index) => 
    <li key={index}
        style={liStyle}>
        <a href={item}>{item}</a>
    </li>
);

const ulStyle = {
  backgroundColor: '#333',
  overflow: 'hidden'
};

export class Header extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            aTags: ['Home', 'Bio', 'Gallery'],
            date: new Date()
        }
    }

    render() {
        return <div>
            <ul style={ulStyle}> 
              {listItems} 
            </ul>
            <h1>Hello World</h1>
        </div>
    }
}
